import * as React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter, Route, Switch } from 'react-router-dom'
import dayjs from 'dayjs';
import Stack from '@mui/material/Stack';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import { DesktopDatePicker } from '@mui/x-date-pickers/DesktopDatePicker';
import { AdapterDayjs } from '@mui/x-date-pickers/AdapterDayjs';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import IncomeStatementsTable from './IncomeStatementsTable';
import CandleChart from './CandleChart';
class FormPropsTextFields extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			valueEnd: dayjs('2030-12-31T00:00:00'),
			valueStart: dayjs('2000-01-01T00:00:00'),
			valueTicker: "GOOG",
			pricingSeries: [{
				data: [{}]
			}],
			pricingOptions: {
				chart: {
					type: 'candlestick',
				},
				title: {
					text: 'CandleStick Chart',
					align: 'left'
				},
				xaxis: {
					type: 'datetime'
				},
				yaxis: {
					tooltip: {
						enabled: true
					}
				},
				id: props.chartId,
			},
			incomeStatementSeries: [{
				data: [{}]
			}],
		}
	};
	handleChangeTicker = newValueTicker => this.setState({ valueTicker: newValueTicker });
	handleChangeStartDate = newValueStartDate => this.setState({ valueStart: newValueStartDate });
	handleChangeEndDate = newValueEndDate => this.setState({ valueEnd: newValueEndDate });
	async componentDidMount() {
		const response = await fetch('/api/stocks/' + this.state.ticker);
		const body = await response.json();
		this.setState({
				series: [{
				data: body.map(day => ({x: new Date(day.date), y:[day.open, day.high, day.low, day.close]}) )
				}],
				pricingOptions: this.state.pricingOptions,
			}
		);
	}
	async componentDidUpdate(prevProps, prevState) {
		if (this.state.ticker !== prevState.ticker) {
			const response = await fetch('/api/stocks/' + this.state.ticker);
			const body = await response.json();
			this.setState({
				pricingSeries: [{
					data: body.map(day => ({ x: new Date(day.date), y: [day.open, day.high, day.low, day.close] }))
				}],
				pricingOptions: this.state.options,
			}
			);
		}
		if (this.state.valueStart !== prevState.valueStart){
			const response = await fetch('/api/stocks/' + this.state.ticker + '/' + this.state.valueStart + '/' + this.state.valueEnd);
			console.log('/api/stocks/' + this.state.ticker + '/' + this.state.valueStart + '/' + this.state.valueEnd);
			const body = await response.json();
			this.setState({
				pricingSeries: [{
					data: body.map(day => ({ x: new Date(day.date), y: [day.open, day.high, day.low, day.close] }))
				}],
				pricingOptions: this.state.pricingOptions,
			}
			);
		}
		if (this.state.valueEnd !== prevState.valueEnd){
			const response = await fetch('/api/stocks/' + this.state.ticker + '/' + this.state.valueStart + '/' + this.state.valueEnd);
			console.log('/api/stocks/' + this.state.ticker + '/' + this.state.valueStart + '/' + this.state.valueEnd);
			const body = await response.json();
			this.setState({
				pricingSeries: [{
					data: body.map(day => ({ x: new Date(day.date), y: [day.open, day.high, day.low, day.close] }))
				}],
				pricingOptions: this.state.pricingOptions,
			}
			);
		}
	}
	render() {
		return (
			<div id="choiceButtons">
				<LocalizationProvider dateAdapter={AdapterDayjs}>
					<Stack direction="row" spacing={2}>
						<TextField
							id="outlined"
							label="Ticker"
							type="text"
							defaultValue="TSLA"
							onChange={(event) => this.handleChangeTicker(event.target.value)}
							inputProps={{ maxLength: 5 }}
						/>
						<DesktopDatePicker
							label="Start Date"
							inputFormat="MM-DD-YY"
							value={this.state.valueStart}
							onChange={(newValue) => {this.handleChangeStartDate(newValue.format("YYYY-DD-MM"));}}
							renderInput={(params) => <TextField {...params} />}
						/>
						<DesktopDatePicker
							label="End Date"
							inputFormat="MM-DD-YY"
							value={this.state.valueEnd}
							onChange={(newValue) => {this.handleChangeEndDate(newValue.format("YYYY-DD-MM"));}}
							renderInput={(params) => <TextField {...params} />}
						/>
						<Button variant="contained"
							onClick={this.onTrigger} >Generate</Button>
					</Stack>
				</LocalizationProvider>
				<BrowserRouter>
                <Switch>
                    <Route path="/CandleChart"
                           render={ () =>
                               <default 
									pricingChartOptions = {this.pricingOptions}
									pricingSeries = {this.pricingSeries} />
                           } />
                    <Route path="/IncomeStatmentsTable"
                           render={ () =>
							<default 
							valueTicker={this.state.valueTicker}
							valueStart={this.state.valueStart}
							valueEnd={this.valueEnd}
							handleChangeTicker = {this.handleChangeTicker}
							handleChangeStartDate = {this.handleChangeStartDate}
							handleChangeEndDate = {this.handleChangeEndDate}
							incomeStatementSeries = {this.incomeStatementSeries}  />
                           } />
                </Switch>
            </BrowserRouter>
			<IncomeStatementsTable/>
			<CandleChart/>
			</div>
		);
	}
}
export default FormPropsTextFields;
